const ViewGeotiff = () => {

	const input_params = JSON.stringify({
		state:"ne,ok",
		grid:"1",
		date:"2012-6",
		elems:[{
			name:"maxt",
			interval:"mly",
			duration:"mly",
			reduce:"max",
		}],
		output:"image",
		image:{
			proj:"lcc",
			overlays:["county:1:gray","state:2:purple"],
			interp:"cspline",
			width:350,
			levels:[90,95,100,105,110],
		},
	});

	const url = "http://data.rcc-acis.org/GridData?params="+input_params

	return (
		<>
			<img src={url}/>
		</>
	);
}

export default ViewGeotiff;
